<h2>Customer Login via OTP</h2>
<div>
<input id="mobile" pattern="[0-9]{10}" placeholder="Enter Mobile Number" required="" type="tel"/>
<button onclick="sendOTP()">Send OTP</button>
</div>
<div class="otp-section" id="otpSection">
<input id="otp" placeholder="Enter OTP" type="text"/>
<button onclick="verifyOTP()">Login</button>
<div class="note" id="otpHint"></div>
</div>
</div>
<script>
    let generatedOTP = "";

    function sendOTP() {
      const mobile = document.getElementById("mobile").value;
      if (mobile.length !== 10) {
        alert("Enter a valid 10-digit mobile number.");
        return;
      }
      generatedOTP = Math.floor(1000 + Math.random() * 9000).toString();
      document.getElementById("otpSection").style.display = "block";
      document.getElementById("otpHint").innerText = "Simulated OTP: " + generatedOTP;
    }

    function verifyOTP() {
      const input = document.getElementById("otp").value;
      if (input === generatedOTP) {
        localStorage.setItem("sevenSolarUser", "customer");
        localStorage.setItem("sevenSolarUsername", document.getElementById("mobile").value);
        window.location.href = "seven-solar-customer-nav-session.html";
      } else {
        alert("Incorrect OTP. Please try again.");
      }
    }
  </script>
</body>
</html>
